import React from "react";

import { Layout } from '../layout';
const Home = () => (
    <Layout>
        <h1 className='text-2xl p-2 text-center'>Sofia'a first Miltipage App
        </h1>
        <div className='p-4'>
            <p>The student of 21 school</p>
            <p>My GitHub</p>
        <p className='text-2xl text-center'>https://github.com/SofiaYooou</p>
        </div>
    </Layout>
);

export default Home;
